import React, { Component } from 'react';
import {Link} from 'react-router-dom';

export default class Koko extends Component {
  render() {
    return (
      <div>
        <Link to="/lyes">
        <h1>
            go to lyes
        </h1>
        </Link>
      </div>
    )
  }
}
